// import logo from './logo.svg';
// import './App.css';

function App() {
  return (
    <div className="App">
       <header className="App-header">

        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <div class="header"></div>
        <div class="body">
          <div class="users"></div>
          <div class="messages"></div>
        </div>
        <div class="footer"></div>
         <p>
           Edit <code>src/App.js</code> and save to reload.wgwgwgwg
         </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
       </header>
    </div>
  );
}

export default App;
